import './NavBar.scss';

import { NavLink } from "react-router-dom";

function NavBar() {
    return (
        <DIV>
            <NavLink to="/">Laurie Villeton</NavLink>

            <nav>
                <NavLink to="/" activeClassName="">Work</NavLink>
                <NavLink to="/"  activeClassName="">About</NavLink>
                <NavLink to="/"  activeClassName="">Contact</NavLink>
            </nav>
        </DIV>
    );
}

export default NavBar;
